import './App.css';

function App() {
  //JSX
  return (
    <div className="App">
      <TodoCount />
      <TodoSearch />
      <TodoList>
        <TodoItem />
        <TodoItem />
        <TodoItem />
      </TodoList>

      <CreateTodoButton />
    </div>
  );
}

function TodoItem() {
  return (
    <li>
      <span>V</span>
      <p> hola mundo </p>
      <span>X</span>
    </li>
  );
}

export default App;
